ABBOTTABAD, Feb 09 (APP): Independent candidate Ali Khan Jadoon has won the National Assembly election from NA-17 constituency Abbottabad-II by securing 97,177 votes.
According to the unofficial result issued by the Returning Officer/ECP, his runner-up was Mohabat Khan Awan from PML-N who bagged 44552 votes. Votersâ€™ turn-out remained at 44.37 per cent.
